import { Link } from "react-router-dom";

const EVENTS = [
    {id: 'e1', title: 'Event 1'},
    {id: 'e2', title: 'Event 2'},
    {id: 'e3', title: 'Event 3'},
];

function EventsPage() {
    return (
        <>
            <h1>Events</h1>
            <ul>
                {EVENTS.map((event) =>
                    <li key={event.id}>
                        <Link to={event.id}>{event.title}</Link>
                    </li>)}
            </ul>
        </>
    );
};

export default EventsPage;
